const INITIAL_STATE = {
  nome: '',
  email: '',
  cpf: '',
  adress: '',
  city: '',
  state: '',
  typePlace: '',
  resume: '',
  job: '',
  jobDescription: '',
}

const inputsReducer = (state, action) => {
  switch (action.type) {
    case "SUBMIT_FORM":
      return state;
    default:
      return state;
  }
}

export default inputsReducer;
